.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);

}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);

    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {

    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }

.accordion {

}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

 key contacts, customer communications, and discussions with your co-workers. Customers matter, but spreadsheets, emails, and sticky notes are a hard way to manage them. CRM centralizes your data so you can manage the sales process, help customers faster, and market smarter. With the CRM tool, it is easy to segment and slice and dice your customers or prospects and convert more leads to sales.*********\ntxt-gray-lighter offset-top-75 offset-md-top-87       *********Add as many employees as you wish to the CRM and automate your business like never before. Please take a closer look at what CRM is and how it helps find, win, and keep customers. Manage your sales pipeline and speed up your closing time with Free CRM. Interactions tracked in the CRM give you a bird\u0027s eye view, and deals are displayed on the dashboard for total visibility into everyone\u0027s progress and obstacles. Enterprise-level security and ongoing support to help you grow. Small businesses can grow faster with all of the tools to fill the sales pipeline through smarter marketing, improved sales productivity, and customer service.*********\noffset-top-23       *********Our company offers professional Free CRM services to boost sales and automate marketing and get more customers. CRM helps your whole team organize and keep track of all of your important corporate data.*********\noffset-top-23       *********Try our mobile CRM applications for Android and iPhone and get your data on mobile on the web. Download and install our CRM apps and log in from anywhere to access your CRM data.*********\noffset-top-22       *********Sales CRM\nHIPAA Medical CRM\nDental CRM\nAutomotive CRM\nCall Center CRM\nInsurance CRM\nReal Estate CRM\nProfessional Services CRM\nContractor Builder CRM\nIndependent Sales CRM\nNPO Nonprofit CRM\nNGO Nongovernment CRM\nWealth \u0026 Finance CRM\nHospitality CRM\nRestaurant CRM\n*********\nprivacy       *********FreeCRM.com © 2021 - Privacy Policy - Terms of Use*********\niTun
